const Total = ({ parts }) => {
    var accumulator = 0
    parts.reduce((accumulator, currentValue) => 
        accumulator + currentValue.excercises,0,
        // console.log(currentValue)
    )
    console.log(Total)
    return(
        <p>Total of {Total} excercises</p>
    )
}

export default Total
